import "./Orb.css";

export default function Orb({ listening, speaking, onClick }) {
  return (
    <div
      className={`orb 
        ${listening ? "listening" : ""} 
        ${speaking ? "speaking" : ""}`}
      onClick={onClick}
    >
      <div className="orb-inner" />
    </div>
  );
}
